    [],nt"num_tags": 38,nt"name": "annual-narrative-target-rock-national-wildlife-refuge-1972",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Target
    Rock National Wildlife Refuge  outlines Refuge accomplishments during the 1972 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, mammals,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, collections and receipts, vegetation
    control, and wildfires. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, violations, and safety. Items of interest,
    photographs, N-R Forms and newspaper articles are included.",nt"owner_org":
